import React from "react";
import JSONPretty from "react-json-pretty";



const ApiResponse = (api) => {
    return(
      <div>
        <div className="form-group">
          <JSONPretty
            id="json-pretty"
            data={this.api}
            space="4"
          ></JSONPretty>
        </div>
      </div>
  )
}
